ERROR - 2015-08-30 05:25:11 --> Query error: Column 'tovar_material_id' cannot be null - Invalid query: INSERT INTO `tovar` (`tovar_name`, `tovar_prise`, `tovar_prise_ab`, `tovar_prise_b`, `tovar_prise_c`, `tovar_skidka`, `tovar_text`, `tovar_razmer`, `tovar_uther`, `tovar_sub_category_id`, `tovar_material_id`, `tovar_color_id`) VALUES ('Евровагонка', '2800', '2800', '', '', NULL, '<p>Евровагонка &ndash; отделочный материал из древесины, применяемый для внутренней и внешней обшивки различных поверхностей, а также в качестве декоративной отделки.Соединение &laquo;шип-паз&raquo; обеспечивает максимально плотное крепление, при этом глубина соединения значительно больше, по сравнению с вагонкой, за счет большей длины шипа, в то время как уровень влажности евровагонки примерно на 10 процентов ниже, что делает евровагонку практически не подверженной деформации и позволяет исключить образование щелей после обшивки. Наличие пазов &ndash; продольных желобков &mdash; обеспечивает эффективное удаление конденсата и циркуляцию воздуха, что способствует уменьшению внутреннего напряжения, связанного с температурными колебаниями и высоким уровнем влажности. Низкая влажность материала позволяет также избежать возникновения шероховатостей на поверхности после обработки ее антисептиком и поражения грибком.</p>\r\n\r\n<p>Евровагонка изготавливается в полном соответствии с европейскими стандартами. К внешнему виду евровагонки предъявляются значительно более строгие требования, в сравнении с обычной вагонкой. На поверхности материала не допускается наличие каких-либо дефектов, сучков и т. д. Древесина для производства евровагонки отбирается самым тщательным образом. Размеры евровагонки также подчинены строгим требованиям евростандарта.</p>\r\n\r\n<p>Ее толщина может иметь значения 13, 16 либо 19 мм, ширина &ndash; 80, 100, 110 или 120 мм. Производство евровагонки осуществляется на высокотехнологичном современном оборудовании, что позволяет исключить возникновение на поверхности материала неровностей, нарушений геометрии и других производственных дефектов.Высокое качество используемой для изготовления евровагонки древесины обуславливает и высокие эксплуатационные характеристики. Евровагонка обеспечивает великолепную звукоизоляцию в помещении, способствует поддержанию оптимальной температуры воздуха и влажности.</p>\r\n\r\n<p>Также, как и обычная вагонка, евровагонка имеет классификацию на категории &ndash; экстра, А, В и С. Сортировка материала подчинена строжайшим нормам, что полностью исключает приобретение товара, не отвечающего заявленному качеству. Изготавливается евровагонка как из хвойных, так и из лиственных древесных пород. Среди хвойных пород наиболее часто используются лиственница, сосна, кедр и ель, среди лиственных &ndash; осина, липа и ольха. Евровагонка из сосны и осины находит широкое применение в качестве материала для обшивки саун и бань.</p>\r\n', '15?19*63?130*500?3000 м2', 'доп информация', '4', NULL, NULL)
